import Error404Page from "../../pages/Error404Page"
import LogInPage from "../../pages/LogInPage"
import MyPosts from "../../pages/MyPosts"
import SignInPage from "../../pages/SignInPage"
import UserProfile from "../../pages/UserProfile"
import MyProfile from "../../pages/MyProfile"
import { DataRouterItemType, DataForLSType } from "../../types/Interfaces"

const localStore = JSON.parse(localStorage.getItem('DataFromLS') !== undefined ? localStorage.getItem('DataFromLS') : '0')

export const PublickDataPaths: DataRouterItemType[] = [
    {
        path: '*',
        element: <Error404Page />,
        id: 1
    },
    {
        path: '/SignIn',
        element: <SignInPage />,
        id: 2
    },
    {
        path: '/LogIn',
        element: <LogInPage />,
        id: 3,
    },
    {
        path: '/MyPosts',
        element: <MyPosts />,
        id: 4
    },
    {
        path: '/Profile',
        element: <MyProfile />,
        id: 5,
    },
    {
        path: 'Post/:id',
        element: <UserProfile />,
        id: 6,
    }
]

export const PrivateDataPaths: DataRouterItemType[] = [
    {
        path: '*',
        element: <Error404Page />,
        id: 1
    },
    {
        path: '/SignIn',
        element: <SignInPage />,
        id: 2
    },
    {
        path: '/LogIn',
        element: <LogInPage />,
        id: 3,
    },
    {
        path: '/MyPosts',
        element: <LogInPage />,
        id: 4
    },
    {
        path: 'Post/:id',
        element: <UserProfile />,
        id: 5,
    }
]
